import React from "react";
import { Scatter } from "react-chartjs-2";
import {
  Chart,
  LinearScale,
  PointElement,
  LineElement,
  Tooltip,
  Legend
} from "chart.js";

Chart.register(LinearScale, PointElement, LineElement, Tooltip, Legend);

export default function VIGraph({ data }) {
  const chartData = {
    datasets: [
      {
        label: "VI Curve",
        data: data.map(row => ({ x: row.voltage, y: row.current })), // <--- KEY CHANGE
        borderWidth: 2,
        showLine: true,
        pointRadius: 0,
        tension: 0.4
      }
    ]
  };

  const options = {
    scales: {
      x: {
        type: "linear",                                    // <--- REQUIRED
        title: { display: true, text: "Voltage (V)" },
        grid: { color: "rgba(180,180,180,0.3)" }
      },
      y: {
        type: "linear",                                    // <--- REQUIRED
        title: { display: true, text: "Current (A)" },
        grid: { color: "rgba(180,180,180,0.3)" }
      }
    }
  };

  return <Scatter data={chartData} options={options} />;
}
